The Secret World of Alex Mack season 1 from 1994


Alex Mack is your typical, ordinary 13-year-old who lives with her &quot;genius&quot; sister Annie, her mom Barbara, &amp; her dad George who is a scientist at the town's chemical plant. On Alex's first day of junior high, everything goes wrong, including being humiliated by the most popular girl in front of one of the most popular guys. While walking home depressed, Alex is almost hit by a truck from the chemical plant that spills a secret &amp; illegal chemical all over her. As a result, she develops the abilities to move objects telekinetically, shoot electric zaps through her fingertips, &quot;morph&quot; into a puddle of liquid, &amp; glow when she gets nervous. Her sister &amp; best friend Ray are the only ones who know about it. With there help, she must keep her powers a secret in fear of becoming the Plant's guinea pig.


